    // Global transition
    //==================
    Transition.prototype.global = function(_controller)
    {
        var
            $current                =   $mainContent.find('.the-view:not(.ajaxnext)')
        ,   $next                   =   $mainContent.find('.ajaxnext')
        ,   timeline                =   new TimelineLite({
                paused : true
            })
        ,   duration                =   1
        ;

        // timeline
        //=========
        timeline.kill();
        timeline.add(
            [
                TweenLite.to($globalFx, duration, { autoAlpha : 1, ease:Sine.easeOut })
            ]
        );
        timeline.call(function() {
            // clean
            $current.remove();
            $next.removeClass('ajaxnext ajaxoverride ajaxhidden');
            JDB.layout.transitionFinalize(_controller);
        });
        timeline.add(
            [
                TweenLite.to($globalFx, .5,  { autoAlpha : 0, ease:Sine.easeOut })
            ]
        );
        timeline.restart();
    }

